import * as React from "react";
import _ from "lodash";
import data from "../../data.json";
import styled from "styled-components";

const Homepage = () => {
	return (
		<>
			<div>
				{_.map(data.restaurant, (res) => {
					return <p>{res.name}</p>;
				})}
			</div>
		</>
	);
};
export default Homepage;
